import React from 'react';
import styled from 'styled-components';

const CubeSide1 = ({ xVal, yVal, zVal }) => {
  const side1 = styled.div`
    transform: rotate3d(1, 1, 1, ${xVal}deg);
  `;

  return (
    <side1>
      <div className='side1'></div>
    </side1>
  );
};

export default CubeSide1;
